<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">

    <link rel="apple-touch-icon" sizes="76x76" href="/static/favicon/apple-touch-icon.png">
    <link rel="icon" type="image/png" sizes="32x32" href="/static/favicon/favicon-32x32.png">
    <link rel="icon" type="image/png" sizes="16x16" href="/static/favicon/favicon-16x16.png">
    <link rel="manifest" href="/static/favicon/site.webmanifest">
    <link rel="mask-icon" href="/static/favicon/safari-pinned-tab.svg" color="#5bbad5">
    <meta name="msapplication-TileColor" content="#da532c">
    <meta name="theme-color" content="#ffffff">

    <title>Not Found</title>
{% block style %}
    {% for url in styles %}<link type="text/css" media="all" rel="stylesheet" href="{{ url }}"/>{{ '\n' }}{% endfor %}
{% endblock %}
</head>
<body>
{% block content %}
    <div id="app"></div>
{% endblock %}
{% block javascript %}
    {% for url in scripts %}{{ '\n' }}<script type="text/javascript" src="{{ url }}"></script>{% endfor %}
{% endblock %}
</body>
</html>
